-- ----------------------------
-- Table structure for account_bank
-- ----------------------------
DROP TABLE IF EXISTS `account_bank`;
CREATE TABLE `account_bank` (
  `id` bigint(11) NOT NULL COMMENT '主键',
  `account_id` bigint(11) DEFAULT NULL COMMENT '帐户Id',
  `bank_id` bigint(11) DEFAULT NULL COMMENT '银行ID',
  `bank_outlets_id` bigint(11) DEFAULT NULL COMMENT '所属开户行ID(网点全部建全需要时间，建议自行输入)',
  `card_no` varchar(22) NOT NULL COMMENT '银行卡号',
  `bank_name` varchar(50) DEFAULT NULL COMMENT '所属银行',
  `outlets_name` varchar(1000) DEFAULT NULL COMMENT '开户行',
  `pro_name` varchar(20) DEFAULT NULL COMMENT '银行所在省（直辖市）',
  `city_name` varchar(20) DEFAULT NULL COMMENT '银行所在市（区）',
  `address` varchar(100) DEFAULT NULL COMMENT '开户行地址',
  `defUse` tinyint(1) DEFAULT NULL COMMENT '默认使用',
  `deleted` tinyint(1) DEFAULT '0' COMMENT '删除标记（1是，0否）',
  `bank_telephone` varchar(50) DEFAULT NULL COMMENT '银行预留手机号',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`),
  KEY `accountId` (`account_id`),
  KEY `bankOutlets` (`bank_outlets_id`),
  KEY `deleted` (`deleted`),
  KEY `cardNo` (`card_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户银行卡信息表';

