DROP TABLE IF EXISTS `u_user_member`;
CREATE TABLE `u_user_member` (
  `id` bigint(11) NOT NULL COMMENT '主键ID',
  `user_name` varchar(50) DEFAULT NULL COMMENT '用户名',
  `real_name` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `idcard` varchar(20) DEFAULT NULL COMMENT '身份证',
  `telephone` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `marital_Status` int(11) DEFAULT '0' COMMENT '婚姻状态-0未填写，1未婚，2已婚，3离异，4丧偶',
  `province` varchar(50) DEFAULT NULL COMMENT '居住地：省',
  `city` varchar(50) DEFAULT NULL COMMENT '市',
  `district` varchar(100) DEFAULT NULL COMMENT '区县街道',
  `educate` varchar(20) DEFAULT NULL COMMENT '学历',
  `industry` varchar(20) DEFAULT NULL COMMENT '行业',
  `occupation` varchar(20) DEFAULT NULL COMMENT '职业',
  `earning` varchar(50) DEFAULT NULL COMMENT '收入',
  `pwd` varchar(50) DEFAULT NULL COMMENT '登录密码',
  `pay_pwd` varchar(255) DEFAULT NULL COMMENT '充值密码',
  `drawPwd` varchar(50) DEFAULT NULL COMMENT '提款密码',
  `validated` tinyint(1) DEFAULT '0' COMMENT '实名认证',
  `regDate` timestamp NULL DEFAULT NULL,
  `trackId` varchar(20) DEFAULT NULL COMMENT '自己的推荐码',
  `loginTime` timestamp NULL DEFAULT NULL COMMENT '最后登录时间',
  `utm_content` varchar(200) DEFAULT NULL,
  `status` int(4) DEFAULT '1' COMMENT '用户状态(0:正常,2:锁定提款)',
  `headerImg` varchar(200) DEFAULT NULL COMMENT '用户头像',
  `level` int(11) DEFAULT '2' COMMENT '0：VIP,1：A类，2：B类，3：C类，',
  `update_Time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `reg_source` int(11) DEFAULT '0' COMMENT '注册来源（0:其它,1:PC,2:H5,3:android,4:IOS)',
  `terminal_id` varchar(100) DEFAULT NULL COMMENT '终端ID',
  `remark` varchar(200) DEFAULT NULL COMMENT '用户备注',
  `locking` int(4) DEFAULT '0' COMMENT '锁定状态（0否，1是）',
  `lock_time` timestamp NULL DEFAULT NULL COMMENT '锁定时间',
  `referral_Code` varchar(255) DEFAULT NULL COMMENT '上级用户的推荐码。',
  PRIMARY KEY (`id`),
  UNIQUE KEY `userName` (`user_name`),
  KEY `email` (`email`),
  KEY `idcard` (`idcard`),
  KEY `trackId` (`trackId`),
  KEY `telephone` (`telephone`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员表';

